import { Outlet, Link } from "react-router-dom";
import logo from '../Res/logo.png';

export default function upload() {
  return (
    <body>
      <header>

        <div className="logo">
          <img src={logo} />
        </div>

        <ul className="menu">
          <li><Link to="/">Home</Link> </li>
          <li><p>Upload CSV</p></li>
        </ul>
      </header>
    </body>
  );

}
